import React, { useState, useEffect } from 'react'

function App() {
  const [data, setData] = useState([{}])

  return (
    <div>
      <p>hier sollte es stehen: {data}</p>
    </div>
  )
}

function getTestData() {
  fetch("/getTestData").then(res => res.json()).then(data => { setData(data) }, [])
}

export default App
